import React from 'react';

function Contact() {
    return (
        <div>
            <h1>Contact Us</h1>
            <p>
                If you have any questions or would like to collaborate with us, please feel free to reach out.
            </p>
            <ul>
                <li>
                    <strong>Email:</strong> <a href="mailto:info@igem-website.com">info@igem-website.com</a>
                </li>
                <li>
                    <strong>Phone:</strong> +1 (123) 456-7890
                </li>
                <li>
                    <strong>Address:</strong> 123 iGEM Street, Synthetic Biology City, SB 12345
                </li>
            </ul>
        </div>
    );
}

export default Contact;
